const gymgraphStyle = theme => ({
    paper: {
        [theme.breakpoints.up("sm")]: {
            width: "700px",
            height: "600px",
            marginRight: "auto",
            marginLeft: "auto",
            marginTop: "2rem",
        }
    },
});

export default gymgraphStyle;
